                                                <div>
                                                    <p>ADVERTISEMENT</p>
                                                    <div class="ats-slot" id="ats-insert_ads-4" style="display: none;">
                                                        <div
                                                            id="google_ads_iframe_/21622890900,21905110999/ID_jogloabang.com_res_article_Mid1_728x90//640x360//300x250//336x280_0__container__"
