                                            <div id="ATS_res_mid1"
                                                 style="margin-left: -10px; margin-bottom: 15px;"></div>
                                            <p>Tabel Standar Antropometri Penilaian Status Gizi Anak ada dalam Lampiran
                                                Permenkes 2 tahun 2020 tentang Standar Antropometri Anak yang memuat
                                                tentang Standar Antropometri Pertumbuhan Anak (GPA) yang terdiri atas
                                                indeks Berat Badan menurut Umur (BB/U), Berat Badan menurut Tinggi Badan
                                                BB/TB), Tinggi Badan menurut Umur (TB/U) dan Indeks Masa Tubuh menurut
                                                Umur (IMT/U).</p>
                                            <p>Permenkes 2 tahun 2020 tentang Standar Antropometri Anak mencabut
                                                Keputusan Menteri Kesehatan Nomor 1995/Menkes/SK/XII/2010 tentang
                                                Standar Antropometri Penilaian Status Gizi Anak karena perlu
                                                menyesuaikan dengan perkembangan dan kebutuhan program perbaikan gizi
                                                masyarakat.</p>
                                            <p>Standar Antropometri Anak digunakan untuk menilai atau menentukan status
                                                gizi anak. Penilaian status gizi Anak dilakukan dengan membandingkan
                                                hasil pengukuran berat badan dan panjang/tinggi badan dengan Standar
                                                Antropometri Anak. Klasifikasi penilaian status gizi berdasarkan Indeks
                                                Antropometri sesuai dengan kategori status gizi pada WHO Child Growth
                                                Standards untuk anak usia 0-5 tahun dan The WHO Reference 2007 untuk
                                                anak 5-18 tahun.</p>
                                            <div id="ATS_pc_mid2" style="margin-left: -10px; margin-bottom: 15px;">
                                                <div id="ats-insert_ads-5-wrapper"
                                                     class="insert_ads insert_ads-3 show_advertisement">
                                                    <div>
                                                        <p>ADVERTISEMENT</p>
                                                        <div class="ats-slot" id="ats-insert_ads-5"
                                                             style="display: none;">
                                                            <div
                                                                id="google_ads_iframe_/21622890900,21905110999/ID_jogloabang.com_res_article_Mid2_728x90//640x360//300x250//336x280_0__container__"
                                                                style="border: 0pt none; width: 300px; height: 0px;"></div>
                                                        </div>
                                                    </div>
                                                </div>
                                            </div>
                                            <p>Penentuan status gizi anak merujuk pada tabel Standar Antropometri Anak
                                                dan grafik pertumbuhan anak, namun grafik lebih menggambarkan
                                                kecenderungan pertumbuhan anak. Baik tabel maupun grafik menggunakan
                                                ambang batas yang sama.</p>
                                            <p>Untuk menentukan status gizi anak, baik menggunakan tabel maupun grafik
                                                perlu memperhatikan keempat indeks standar antropometri secara bersamaan
                                                sehingga dapat menentukan masalah pertumbuhan, untuk dilakukan tindakan
                                                pencegahan dan tata laksana lebih lanjut.</p>
                                        </div>
                                        <div
                                            class="field field--name-field-body-2 field--type-text-long field--label-hidden field-item">
                                            <p>Tabel Standar Antropometri Pertumbuhan Anak (GPA) terdiri atas indeks
                                                Berat Badan menurut Umur (BB/U), Berat Badan menurut Tinggi Badan
                                                BB/TB), Tinggi Badan menurut Umur (TB/U) dan Indeks Masa Tubuh menurut
                                                Umur (IMT/U), sebagai berikut:</p>
                                            <h2 align="center">Tabel Standar Antropometri Penilaian Status Gizi
                                                Anak</h2>
