                                            <p>Standar Antropometri Anak digunakan untuk menetapkan acuan dalam
                                                penilaian status gizi dan tren pertumbuhan Anak Indonesia, sebagai
                                                rujukan untuk mengidentifikasi anak-anak yang berisiko gagal tumbuh
                                                tanpa menunggu sampai anak menderita masalah gizi, serta sebagai dasar
                                                untuk mendukung kebijakan kesehatan dan dukungan publik terkait dengan
                                                pencegahan gangguan pertumbuhan.</p>
